function Task(props) {
   const content = props.users.map((post) =>
       <div key={post.id}>
           <h3>{post.name}</h3>
           <p>{post.surname}</p>
       </div>
   )

    return(
        <div>
            {content}
        </div>
    )
}


export default Task;
